import React from 'react';

const Instructions = () => {
   return (
      <main className="container">
         <div className="jumbotron bg-transparent">
            <h3 className="text-center">What to expect</h3>
            <div className="row">
               <div className="col-sm text-body">
                  <i className="bi bi-volume-up-fill display-1"></i>
                  <p>Calibration</p>
               </div>
               <div className="col-sm text-body">
                  <i className="bi bi-headphones display-1"></i>
                  <p>Hearing Screening</p>
               </div>
               <div className="col-sm text-body">col-sm</div>
            </div>
         </div>
      </main>
   );
}

export default Instructions;
